  const { authToken, logout } = useAuth();

  return (
    <HeaderStyled>
      <div className="image-container">
        <Link className="imageLink" to="/">
          <img
            className="linkImage"
            src={logoWithoutName}
            alt="botÃ£o da home page"
          />
        </Link>
      </div>
      <Link className="link" to="/imoveis">
